def lotto(request):
    winning = [3, 11, 15, 20, 35, 44]
    bonari = 10
    context = {
        'numbers': [],
    }
    for _ in range(5): 
        num = random.sample(range(1, 46), 6)
        cnt = 0
        bonus = 0
        for i in num:
            if i in winning:
                cnt += 1
            if i == bonari:
                bonus += 1
        if cnt == 6:
            num.append('1등!!!!!!')
        elif cnt == 5 and bonus == 1:
            num.append('2등!!!!!')
        elif cnt == 5 and bonus == 0:
            num.append('3등!!!!')
        elif cnt == 4:
            num.append('4등!!!')
        elif cnt == 3:
            num.append('5등!!')
        else:
            num.append('꽝!')
        context['numbers'].append(num)
    return render(request, 'lotto.html', context)
